import React from "react";
import { Box, Heading, useColorMode } from "@chakra-ui/core";

const Settings = () => {
  const { colorMode } = useColorMode();
  return (
    <Box>
      <Heading bg={`mode.${colorMode}.card`} color={`mode.${colorMode}.title`}>
        Settings
      </Heading>
    </Box>
  );
};

export default Settings;
